import React, { useState } from 'react';
import '../css/Login.css';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loginType, setLoginType] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLoginTypeChange = (e) => {
    setLoginType(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform login logic here with email, password, and login type
    // Example: You can send the data to an API endpoint or authenticate the user locally
    console.log('Email:', email);
    console.log('Password:', password);
    console.log('Login Type:', loginType);
    // Reset form fields
    setEmail('');
    setPassword('');
    setLoginType('');
  };

  return (
    <div className="login-container">
      <div className="login-image">
        <img src="data:image/webp;base64," alt="Login Image" />
      </div>
      <div className="login-form">
        <h2>Login</h2>
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>
          <div>
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={handlePasswordChange}
              required
            />
          </div>
          <div>
            <label htmlFor="loginType">Login Type</label>
            <select
              id="loginType"
              value={loginType}
              onChange={handleLoginTypeChange}
              required
            >
              <option value="">Select login type</option>
              <option value="propertyOwner">Landlord</option>
              <option value="residentOwner">Agent</option>
              <option value="residentOwner">Caretaker</option>
              <option value="residentOwner">Tenant</option>
            </select>
          </div>
          <button type="submit">Login</button>
        </form>
        <p>
          <button>Forgot Password</button>
        </p>
      </div>
    </div>
  );
};

export default Login;
